// src/components/FirmFactCard/FirmFactCard.tsx
import React from 'react';
import Button from '../Button/Button';
import './FirmFactCard.scss';

interface FirmFactCardProps {
  variant: 'default' | 'border' | 'oneLine';
}

const FirmFactCard: React.FC<FirmFactCardProps> = ({ variant }) => {
  return (
    <div className={`firmFactCard firmFactCard--${variant}`}>
      <Button
        variant={variant === 'oneLine' ? 'icon' : 'default'}
        text={
          variant === 'oneLine'
            ? 'this is a one line button'
            : 'this is a two line button that terminest with ...'
        }
        disabled={false} // Set to true for disabled state
      />
    </div>
  );
};

export default FirmFactCard;
